import React, { useEffect, useState } from "react";
import { Outlet } from "react-router-dom";
import Log from "./Log";
import axios from "axios";
function Pr() {
  const [per, setper] = useState(false);
  useEffect(() => {
    async function pro() {
      const ud = sessionStorage.getItem("ud");
      await axios
        .post("http://localhost:4000/pr", {
          ud: ud,
        })
        .then((res) => {
          if (res.data.per === "ac") {
            setper(true);
            console.log(per);
          } else {
            setper(false);
          }
        });
    }
    pro();
  }, []);
  return per? <Outlet /> : <Log />;
}
export default Pr;
